import { all, fork, takeLatest, put, call } from 'redux-saga/effects';
import {LOG_IN_REQUEST, loginRequestAction} from "../reducers/user";

function* watchLogIn() {
  yield takeLatest(LOG_IN_REQUEST);
}

export default function* userSaga() {
  yield all([
    fork(watchLogIn),
    fork(watchLogOut),
  ])
}
